result:
.approver-pane {
  overflow: hidden;
  height: 100%;
  .config-scrollbar {
    height: 100%;
    overflow: hidden;
    .el-row {
      font-size: 14px;
      color: #606266;
      height: 32px;
      line-height: 32px;
    }
  }

  .per-cell {
    display: flex;
    align-items: center;
    margin-bottom: 10px;
    .el-checkbox {
      margin-right: 40px;
    }
    &:last-child {
      margin-bottom: unset;
    }
  }
}
.form-item-label {
  font-weight: 600;
  font-size: 14px;
  line-height: 32px;
  &.color {
    color: rgba(0, 0, 0, 0.85);
  }
}
.clearn {
  cursor: pointer;
  font-size: 18px;
  line-height: 32px;
  color: #ed6f6f;
}
>>> .clearn-color {
  margin: 0 -18px !important;
}
>>> .el-dialog__body {
  padding: 10px 10px 0 !important;
}
>>> .popup-main {
  .pop_btn {
    display: none !important;
  }
  .popup-result:nth-child(2) {
    margin-bottom: 2px;
  }
}
.delBtn {
  text-align: right;
}
.mt-10px {
  margin-top: 10px;
}
.mb-10px {
  margin-bottom: 10px;
}
.form-item-color {
  color: #aaaaaa;
}
.condition-pane {
  height: 100%;
  overflow: auto;
  overflow-x: hidden;
}
.link-text {
  color: #1890ff;
  cursor: pointer;
  user-select: none;
}
.mr-20px {
  margin-right: 20px;
}
.inline-block {
  display: inline-block;
}
.mr-4px {
  margin-right: 4px;
}
.cursor-pointer {
  cursor: pointer;
}
